We showcase an example pipeline of running the BEIR ( paper ) benchmark in HyperMake. BEIR is a robust and heterogeneous evaluation benchmark for zero-shot information retrieval. It includes a diverse set of retrieval tasks, such as web search, question answering, and entity retrieval. The benchmark is designed to evaluate the generalization capabilities of retrieval models across different tasks and domains. In this example, we run the standard BM25 lexical retrieval model (with Pyserini ) on the BEIR-14 subset (those with public licenses), evaluated with the standard trec_eval evaluation tool. First, let's import some modules to simplify the pipeline definition: import conda
import std Next, we define some hyperparameters for the pipeline. BEIR-14 datasets, defined as a HyperMake variable: beir_dataset = {BeirDataset: msmarco trec-covid nfcorpus nq hotpotqa fiqa arguana webis-touche2020 quora dbpedia-entity scidocs fever climate-fever scifact
} Partition of the datasets that we want to evaluate (MSMARCO is evaluated on the dev set), defined as a HyperMake dict: test_partition = {BeirDataset: msmarco=dev trec-covid=test nfcorpus=test nq=test hotpotqa=test fiqa=test arguana=test webis-touche2020=test quora=test dbpedia-entity=test scidocs=test fever=test climate-fever=test scifact=test
} And a constant for the data downloading URL prefix: beir_url_prefix = "https://public.ukp.informatik.tu-darmstadt.de/thakur/BEIR/datasets" package trec_eval -> out: git clone https://github.com/usnistgov/trec_eval.git $out cd $out make

