Here Python code is embedded directly in the task definition with std.run as an example, showing how to use Python code directly in the task definition. This is useful for small scripts that are not worth putting in a separate file. This script is actually large enough that it would be better to put it in a separate file, but for the sake of demonstration, we include it here. Note the use of @conda.activate to run this task in the Pyserini environment we created earlier. @conda.activate(environment=$pyserini)
@std.run(interpreter="python")
task beir_to_trec(data=$raw_beir_data.out) -> out: import os import json import sys import csv from tqdm import tqdm data = os.environ['data'] # HyperMake variables are sent as environment variables out = os.environ['out'] os.mkdir(out) with open(f"{data}/corpus.jsonl") as f_in, open(f"{out}/corpus", 'w') as f_out: for line in tqdm(f_in): obj = json.loads(line) id = obj['_id'] text = obj['text'].replace('\n', ' ').replace('\t', ' ').replace('\r', ' ') title = obj.get('title', "") trec_line = f"{id}\t{title}: {text}" if title != "" else f"{id}\t{text}" # Concatenate title and text print(trec_line, file=f_out) queries = {} with open(f"{data}/queries.jsonl") as f: for line in tqdm(f): obj = json.loads(line) id = obj['_id'] text = obj['text'] queries[id] = text for partition in os.listdir(f"{data}/qrels"): partition = os.path.splitext(partition)[0] with open(f"{data}/qrels/{partition}.tsv") as f_in, open(f"{out}/{partition}.qrels", 'w') as f_out: query_ids = set() for row in tqdm(csv.DictReader(f_in, delimiter='\t')): query_ids.add(row['query-id']) print(f"{row['query-id']}\t0\t{row['corpus-id']}\t{row['score']}", file=f_out) with open(f"{out}/{partition}.queries", 'w') as f: for query_id in query_ids: print(f"{query_id}\t{queries[query_id]}", file=f)

